import React from 'react';
import NB from './NavBar/NB';
import './index.css';
import Price from './price/infoprice';
import PB from './PromoBlock/PB';
import Form from './Forma/Form';

function App() {
  const isLoggedIn = props.isLoggedIn;
  if (isLoggedIn) {
    return (
      <div className="App">
        <Form />
      </div>
    );
  }
  return (
    <div className="App">
      <NB />
      <PB />
      <Price />
    </div>
  );
}

export default App;
